column8:
「ハンドラボ 手指消毒ハンドジェルVS 40ml」は、リン酸でpHを酸性にし、有効成分(エタノール)の効果を高めた消毒・除菌用ジェル(携帯用)です。幅広いウイルス・細菌に対応します。携帯用。無香料。指定医薬部外品。<br><br>使用方法<br>1.ジェルを適量手に取ります。<br>2.指先・指の間に乾くまでよく擦り込みます。<br>※すぐ乾きますので、タオルなどでの抜き取りの必要はありません。<br>使用上の注意<br>■ご使用に際して、この袋の説明を必ずお読みください。<br>●してはいけないこと(守らないと現在の症状が悪化したり、副作用が起こりやすくなる)<br>(1)次の人は使用しないこと<br>・患部が広範囲の人。<br>・深い傷やひどいやけどの人。<br>(2).次の部位には使用しないこと<br>・損傷のある手指・皮膚・口唇等の粘膜の部分、目の周り。(局所刺激作用がある。)<br><br>●相談すること<br>(1)次の人は使用前に医師又は薬剤師に相談すること<br>・医師の治療を受けている人。<br>・本人又は家族がアレルギー体質の人。<br>・薬によりアレルギー症状を起こしたことがある人。<br>(2)次の場合は、直ちに使用を中止し、この容器を持って医師又は薬剤師に相談すること<br>使用後、皮膚に発疹・発赤、かゆみの症状があらわれた場合。<br>火気厳禁<br>危険物第4類アルコール類(エタノール)/引火性/水溶性/危険等級II<br>原産国：日本<br>効能・効果<br>手指・皮ふの洗浄・消毒<br>用法・用量<br>●用法及び用量<br>適量を手に取り、指先までムラなく乾くまで擦り込む。<br>●用法及び用量に関連する注意<br>(1)濡れていたり、汚れていると効果が低下するので、適用箇所を洗い、水分を取り除いてから使用すること。<br>(2)小児に使用させる場合には、保護者の指導監督のもとに使用させること。<br>(3)目に入らないように注意すること。万一、目に入った場合には、すぐに水又はぬるま湯で洗うこと。なお、症状が重い場合には、眼科医の診療を受けること。<br>(4)外用にのみ使用すること。<br>成分・分量<br>●成分及び分量<br>ハンドジェルVSは、有効成分としてエタノール(C2H6O)76.9-81.4vol%、添加物としてグリセリン、疎水化ヒドロキシプロピルメチルセルロース、ミリスチン酸イソプロピル、アラントイン、リン酸を含有する。<br><br>保管および取扱い上の注意<br>(1)直射日光の当たらない涼しい所に密栓して保管すること。<br>(2)小児の手の届かない所に保管すること。<br>(3)他の容器に入れ替えないこと。(誤用の原因になったり品質が変わる。)<br>(4)取扱う場合、換気を十分行うこと。<br>(5)火気に近づけないこと。<br>(6)本剤はアルコールを含有しているため、床などの塗装面や衣服などについたりすると変色する場合があるので注意すること。<br>(7)先が詰まる場合には、詰まりを取り除いてから使用すること。<br>お問い合わせ先<br>サラヤ株式会社<br>大阪市東住吉区湯里2-2-8<br>0120-40-3636<br>区分：指定医薬部外品<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
